import React from "react";

// css 
import style from './containerData.module.css';

// images 
import fireSVG from '../../images/fire.svg';
import thighSVG from '../../images/thigh.svg';
import appleSVG from '../../images/apple.svg';
import cheeseburgerSVG from '../../images/cheeseburger.svg';

interface Props {
    param : IParamContainerData,
    keyImage: string
}


export const ContainerData: React.FC<Props> = ({ param, image }) => {
    return (
        <>
            <div className={style.containerData}>
                <div className={style.icon} style={{background: param.color}}>
                    <iframe title={param.name} src={image}>

                    </iframe>

                </div>
                <div>
                    <p>{param.value}{param.unite}</p>
                    <p>{param.name}</p>
                </div>
            </div>
        </>
    );
}
